import './App.css'
import { useState } from "react";
import Employee from './Employee';
function App() {
  const [count, setCount] = useState(0)

  const addCount = () => {
    setCount(count + 1)
    console.log(count);

  };
  const emp = [{
    name: 'vaishnav',
    age:26
  },{
    name: 'midhun',
    age:22
  },{
    name: 'Rahul',
    age:23
  }]
  return (
    <div>

      <button onClick={addCount}>Add</button>
      {
        emp.map((obj,index) => {
          return (
            <Employee key={index} name={obj.name } age={obj.age} />
          )
        })
     }

    </div>
  );
}



export default App;
